import { Radio} from '@mui/material';
import { useState } from 'react';
import swal from '@sweetalert/with-react';


export const forgetPsswrd = () =>{
    
    const [selectedValue, setSelectedValue] = React.useState('a');

    const handleChange = (event) => {
    setSelectedValue(event.target.value);
    };

    swal({
        buttons: {
          cancel: "Cancelar",
          ok:"continuar"
        },
        content: (
            <div>
            <h1>¿Has olvidado tu contraseña?</h1>
            <p>Selecciona una opción de recuperación</p>
            <p><Radio checked={selectedValue==="a"} onChange={handleChange} value="a" name="radio-buttons" inputProps={{ 'aria-label': 'A' }} />Enviarme por correo electronico un codigo de recuperación </p>
            <p><Radio checked={selectedValue==="b"} onChange={handleChange} value="b" name="radio-buttons" inputProps={{ 'aria-label': 'B' }} />Responder preguntas de seguridad</p>
            
        </div>
        )
    }).then((a)=>{
        if (a) {
            swal("Poof! Your imaginary file has been deleted!", {
              icon: "success",
            });
          } else {
            swal("Your imaginary file is safe!");
          }
    })
}
export const click2 = ()=>{
    alert("Click2")
}
